#include <iostream>

using namespace std;

const int csize = 16 * 1024;
int tag[csize], f[csize], c[csize], r[csize];
bool v[csize];


enum cacheResType { MISS = 0, HIT = 1 };

unsigned int memGenSeq()
{
  static unsigned int addr = 0;
  return (addr++) % (1024 * 1024);
}

unsigned int memGenRandom()
{
  return rand() % (1024 * 1024);
}

unsigned int memGenLoop1()
{
  static unsigned int addr = 0;
  return (addr++) % (1024 * 4);
}

unsigned int memGenLoop2()
{
  static unsigned int addr = 0;
  return (addr++) % (1024 * 24);
}

// Direct Mapped Cache Simulator
cacheResType cacheSimDM(unsigned int addr, int ls)
{
  // This function accepts the memory address for the read and 
  // returns whether it caused a cache miss or a cache hit

  // The current implementation assumes there is no cache; so, every transaction is a miss

  int index = (addr / ls) % (csize / ls); // index = (address / line size) % no of lines
  int t = addr / (csize);

  if (v[index])
    if (tag[index] == t)
      return HIT;
    else
    {
      tag[index] = t;
      return MISS;
    }
  else
  {
    v[index] = true;
    tag[index] = t;
    return MISS;

  }

}

// Fully Associative Cache Simulator
cacheResType cacheSimFA(unsigned int addr, int ls, char mode)
{
  // This function accepts the memory address for the read and 
  // returns whether it caused a cache miss or a cache hit

  // The current implementation assumes there is no cache; so, every transaction is a miss
  int t = addr / (ls);
  for (int i = 0; i<csize; i++)   // LRU
    r[i]++;     //LRU

  for (int i = 0; i<csize; i++)  // search in all cache .. if found return HIT
  {
    if (v[i])
    {
      if (f[i] == t)
      {
        c[i]++;	 //LFU
        r[i] = 0;    //LRU
        cout << "OOO";
        return HIT;
      }
    }
  }
  for (int i = 0; i<csize; i++)	// not found in cache .. put it in the first empty place
  {
    if (!v[i])
    {
      f[i] = t;
      c[i]++;	 //LFU
      r[i] = 0;	 // LRU
      v[i] = true;
      cout << "Zeinab";
      return MISS;
    }
  }
  switch (mode){
  case 'd':
  case 'D':
  {

    int l = rand() % csize;
    f[l] = t;	// random.
    v[l] = true;
    cout << "kkkk";
    return MISS;
  }

  case 'r':
  case 'R':
  {
    int max = 0;	 // LRU
    for (int i = 0; i<csize; i++)
      if (r[i]>r[max])   //least recently used
        max = i;
    f[max] = t;
    r[max] = 0;
    v[max] = true;
    cout << "yyyyyy";
    return MISS;
  }

  case 'f':
  case 'F':
  {
    int	min = 0;
    for (int i = 0; i<csize; i++)	// address not found .. cache is full ..
      if (c[i]<c[min])
        min = i;	 // Least Frequently used
    f[min] = t;
    c[min]++;
    v[min] = true;
    cout << "hhhhhhhh";
    return MISS;
  }
  }
}

char *msg[2] = { "Miss", "Hit" };

int main()
{
  for (int i = 0; i<csize; i++)
  {
    v[i] = false;
    tag[i] = f[i] = 0;	 // initalize all valididty bits and tags to be zero
  }

  int inst = 0;
  cacheResType r;
  float h = 0, m = 0;
  int total;
  int ls;
  char type;
  char a; char mode;

  unsigned int addr;
  //cout<<"Enter number of instructions"<<endl;
  /*cin>>*/total = 1000000;
  cout << "Please enter which cache type you want to use, Direct mapped Cache = D" << endl << "Fully associative cache = F" << endl;
  cin >> type;
  switch (type)
  {

    //for direct mapped cache:
  case 'd':
  case 'D':
  {
    cout << "Random= R" << endl << "Seq= S" << endl << "Loop1 = 1" << endl << "Loop 2 = 2" << endl;
    cin >> a;
    cout << "Enetr Line Size" << endl;
    cin >> ls;

    for (; inst<total; inst++)
    {
      if (a == 'R' || a == 'r') addr = memGenRandom();
      if (a == 'S' || a == 's') addr = memGenSeq();
      if (a == '1')	 addr = memGenLoop1();
      if (a == '2')	 addr = memGenLoop2();

      r = cacheSimDM(addr, ls);
      if (r == MISS)
        m++;
      else
        h++;
      //cout << addr <<" ("<< msg[r] <<")\n";
    }

    cout << "Direct Mapped Cache" << "   " << "line Size = " << ls << endl;
    if (a == 'R' || a == 'r') cout << "Random Addresses" << endl;
    if (a == 'S' || a == 's') cout << "Sequential Addresses" << endl;
    if (a == '1')	 cout << "Loop 1 Addresses" << endl;
    if (a == '2')	 cout << "Loop 2 Addresses" << endl;
    cout << "HIT ratio = " << (h / total) * 100 << "%" << endl;
    break;
  }

  //for fully associative cache
  case 'f':
  case 'F':
  {
    cout << "Random= R" << endl << "Seq= S" << endl << "Loop1 = 1" << endl << "Loop 2 = 2" << endl;
    cin >> a;
    cout << "Enetr Line Size" << endl;
    cin >> ls;
    cout << "Choose the replacment Policy" << endl
      << "Random = D" << endl
      << "Least Recently Used = R" << endl
      << "Least Frequently Used = f" << endl;
    cin >> mode;

    for (; inst<total; inst++)
    {
      if (a == 'R' || a == 'r') addr = memGenRandom();
      if (a == 'S' || a == 's') addr = memGenSeq();
      if (a == '1')	 addr = memGenLoop1();
      if (a == '2')	 addr = memGenLoop2();

      r = cacheSimFA(addr, ls, mode);
      if (r == MISS)
        m++;
      else
        h++;
      //cout << addr <<" ("<< msg[r] <<")\n";
    }
    cout << "Fully Associative Cache" << "    " << "line Size = " << ls << endl;

    if (a == 'R' || a == 'r') cout << "Random Addresses" << endl;
    if (a == 'S' || a == 's') cout << "Sequential Addresses" << endl;
    if (a == '1')	 cout << "Loop 1 Addresses" << endl;
    if (a == '2')	 cout << "Loop 2 Addresses" << endl;

    if (mode == 'D' || mode == 'd')	cout << "Random" << endl;
    if (mode == 'R' || mode == 'r')	cout << "Least Recently Used" << endl;
    if (mode == 'F' || mode == 'f')	cout << "Least Frequently Used" << endl;
    cout << "HIT ratio = " << (h / total) * 100 << "%" << endl;
    break;
  }



  }
  system("pause");
}

